let pageScroll = function () {
	let scroll = $( window ).scrollTop();
	const siteHeader = document.querySelector( '.site-header' );
	if ( siteHeader ) {
		if ( scroll > 0 ) {
			siteHeader.classList.add( 'js-fixed' );
		} else {
			siteHeader.classList.remove( 'js-fixed' );
		}
	}
};
